import React from 'react'
import '../Menu/Menu.css'
import butter from '../Assets/logo.png'

function Default(logo) {
    return (
        <div className="logo">
            <img src={butter} alt="logo"/>
            <h4>To Begin, Please make a selection.</h4>
        </div>
    )
}

export default Default
